import "./CardEdit.css";
import React, { useContext } from 'react';
import DataContext from '../../ContextAPI/Context'
import { Link } from 'react-router-dom';
import Navbar from "../Navbar/Navbar";

const CardEdit = () => {

  const { categories, subCategories, products } = useContext(DataContext);

  return (
    <>
      <Navbar />
      {categories.map((category) => (
        <div className="card-wrapper" key={category._id} id={category.name}>

          <div className="category-header-in-wrapper">
            <span>
              <h5>{category.name} | </h5>
              {subCategories.filter((subCategory) => subCategory.category === category.name).map((subCategory) =>
                <nav aria-label="breadcrumb" key={subCategory._id}>
                  <ol class="breadcrumb">
                    <li class="breadcrumb-item"><a href="#">Home</a></li>
                    <li class="breadcrumb-item"><a href="#">Library</a></li>
                    <li class="breadcrumb-item active" aria-current="page">Data</li>
                  </ol>
                </nav>
              )}</span>
            <Link to={`/cardpage?category=${encodeURIComponent(category.name)}`}>See all</Link>
          </div>
        </div>
      ))}
    </>
  );
}

export default CardEdit;
